[{"name": "mcp__togomcp__search_bacdive_entity", "input": {"query": "Methanocaldococcus jannaschii"}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "taxonomy", "query": "Methanocaldococcus jannaschii"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?strain ?strainLabel ?medium ?sc
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain ;
          rdfs:label ?strainLabel .
  ?strainLabel bif:contains "'Methanocaldococcus' AND 'jannaschii'" option (score ?sc) .

  OPTIONAL {
    ?m a schema:CultureMedium ;
       schema:describesStrain ?strain ;
       rdfs:label ?medium .
  }
}
ORDER BY DESC(?sc)
LIMIT 20"}}]

