[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT DISTINCT ?strain ?strainLabel ?genus ?species ?tempStart ?tempEnd
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain ;
          rdfs:label ?strainLabel ;
          schema:hasGenus ?genus ;
          schema:hasSpecies ?species .

  ?temp a schema:CultureTemperature ;
        schema:describesStrain ?strain ;
        schema:hasTemperatureRangeStart ?tempStart ;
        schema:hasTemperatureRangeEnd ?tempEnd .

  FILTER(?tempStart > 80 || ?tempEnd > 80)
}
ORDER BY DESC(?tempEnd)
LIMIT 500"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT DISTINCT ?genus ?species (MAX(?tempEnd) as ?maxTemp) (COUNT(DISTINCT ?strain) as ?strainCount)
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain ;
          schema:hasGenus ?genus ;
          schema:hasSpecies ?species .

  ?temp a schema:CultureTemperature ;
        schema:describesStrain ?strain ;
        schema:hasTemperatureRangeEnd ?tempEnd .

  FILTER(?tempEnd > 80)
}
GROUP BY ?genus ?species
ORDER BY DESC(?maxTemp) ?genus ?species
LIMIT 100"}}]

