[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/nando#>
PREFIX dcterms: <http://purl.org/dc/terms/>

SELECT ?disease ?label ?notificationNumber
WHERE {
  ?disease rdfs:label ?label .
  ?disease nando:notificationNumber ?notificationNumber .
  FILTER(CONTAINS(LCASE(?label), "parkinson"))
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/nando#>

SELECT ?disease ?label ?altLabel ?notificationNumber
WHERE {
  ?disease a nando:Disease .
  OPTIONAL { ?disease rdfs:label ?label . }
  OPTIONAL { ?disease nando:hasNotificationNumber ?notificationNumber . }
  OPTIONAL { ?disease rdfs:label ?altLabel . }
  FILTER(CONTAINS(LCASE(STR(?label)), "parkinson") || CONTAINS(LCASE(STR(?altLabel)), "parkinson"))
}
LIMIT 10
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT ?disease ?en_label ?ja_label ?notificationNumber
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?disease a owl:Class ;
           rdfs:label ?en_label ;
           nando:hasNotificationNumber ?notificationNumber .
  OPTIONAL {
    ?disease rdfs:label ?ja_label .
    FILTER(LANG(?ja_label) = "ja" && !REGEX(STR(?ja_label), "^[ぁ-ん]+$"))
  }
  ?en_label bif:contains "'Parkinson*'" option (score ?sc) .
  FILTER(LANG(?en_label) = "en")
}
ORDER BY DESC(?sc)
LIMIT 10
"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

