          schema:hasGenus ?genus ;
          schema:hasSpecies ?species .
  FILTER(CONTAINS(LCASE(?genus), "thermotoga"))
  FILTER(CONTAINS(LCASE(?species), "maritima"))

  OPTIONAL {
    ?ccn a schema:CultureCollectionNumber ;
         schema:describesStrain ?strain ;
         rdfs:label ?collectionLabel ;
         schema:hasLink ?link .
  }
}
ORDER BY ?strainLabel
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT DISTINCT ?collectionLabel
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain ;
          schema:hasGenus ?genus ;
          schema:hasSpecies ?species .
  FILTER(CONTAINS(LCASE(?genus), "thermotoga"))
  FILTER(CONTAINS(LCASE(?species), "maritima"))

  ?ccn a schema:CultureCollectionNumber ;
       schema:describesStrain ?strain ;
       rdfs:label ?collectionLabel .
}
ORDER BY ?collectionLabel"}}]

